import React,{useState,useEffect} from 'react';

function Dashboard() {
	const[data,setData]=useState("");
	useEffect(()=>{
		fetch("https://jsonplaceholder.typicode.com/users")
		.then((response)=>response.JSON())
		.then((data)=>setData(data))
	},[])
  return (
  <>
  {data.map((data)=>
		<table>
		<tr>
		<td>{data.id}</td>
		<td>{data.name}</td>
		<td>{data.username}</td>
		<td>{data.email}</td>
		</tr>
		</table>
  )}
  </>
  );
}

export default Dashboard;
